        "body": "<!-- Hey there. Thank you so much for improving NewPipe, and filling out the details. Having roughly the same layout helps everyone considerably :)-->\r\n\r\n#### What is it?\r\n- [ ] Bugfix (user facing)\r\n- [X] Feature (user facing)\r\n- [ ] Codebase improvement (dev facing)\r\n- [ ] Meta improvement to the project (dev facing)\r\n\r\n#### Description of the changes in your PR\r\n<!-- While bullet points are the norm in this section, feel free to write free-form text instead of a list -->\r\n- Import a playlist from a text file containing links of youtube videos.\r\n- Name of the file is the name of the playlist.\r\n- [#9921](https://github.com/TeamNewPipe/NewPipe/issues/9921)\r\n\r\n#### Before/After Screenshots/Screen Record\r\n<!-- If your PR changes the app's UI in any way, please include screenshots or a video showing exactly what changed, so that developers and users can pinpoint it easily. Delete this if it doesn't apply to your PR.-->\r\n- Before:\r\n![Screenshot_20231029-085952](https://github.com/TeamNewPipe/NewPipe/assets/90856865/bdb19054-36b2-4e02-b6f6-e6f6ef7a0242)\r\n\r\n- After:\r\n![A menu button](https://github.com/TeamNewPipe/NewPipe/assets/90856865/96fc3e89-46bd-4348-b292-cb4e4f40ba3e)\r\n![Import option](https://github.com/TeamNewPipe/NewPipe/assets/90856865/67286a17-a64d-4cca-9d2f-905ec80ae63f)\r\nThe file manager is opened onClick, and the added playlist would appear as any other that is added by the user manually when watching.\r\n\r\n#### Relies on the following changes\r\n<!-- Delete this if it doesn't apply to your PR. -->\r\n-  Made some modifications to BookmarkFragment\r\n-  Added a new class BookmarkImportService\r\n\r\n#### APK testing\r\n<!-- Use a new, meaningfully named branch. The name is used as a suffix for the app ID to allow installing and testing multiple versions of NewPipe, e.g. \"commentfix\", if your PR implements a bugfix for comments. (No names like \"patch-0\" and \"feature-1\".)  -->\r\n- It could take a couple of seconds for the playlist to appear. A toast message appears once the playlist is added.\r\n\r\n\r\n#### Due diligence\r\n- [X] I read the [contribution guidelines](https://github.com/TeamNewPipe/NewPipe/blob/HEAD/.github/CONTRIBUTING.md).\r\n",
