        "body": "<!-- Hey there. Thank you so much for improving NewPipe, and filling out the details. Having roughly the same layout helps everyone considerably :)-->\r\n\r\n#### What is it?\r\n- [X] Bugfix (user facing)\r\n- [ ] Feature (user facing)\r\n- [ ] Codebase improvement (dev facing)\r\n- [ ] Meta improvement to the project (dev facing)\r\n\r\n#### Description of the changes in your PR\r\n<!-- While bullet points are the norm in this section, feel free to write free-form text instead of a list -->\r\n- I took some lines off the code where a drawable_image was rendered and made final, even though there were other images rendered from cache.\r\n- I also added a column in the 'streams' table in the database, to accommodate the storage of urls of channel avatar. I used the methods written in ImageStrategy.class to convert List<Image> to String URLs.\r\n- Due to adding a column for the table 'streams' in the database, I had to migrate the database version from DB_VER_7 to DB_VER_8.\r\n\r\n#### Before/After Screenshots/Screen Record\r\n\r\n<!-- If your PR changes the app's UI in any way, please include screenshots or a video showing exactly what changed, so that developers and users can pinpoint it easily. Delete this if it doesn't apply to your PR.-->\r\n- Before:  ![before](https://github.com/TeamNewPipe/NewPipe/assets/90856865/8055bc58-0fc0-449b-a64e-e6640bf4b5da)\r\n- After:     ![after](https://github.com/TeamNewPipe/NewPipe/assets/90856865/11794bc9-b99d-429d-832b-4f8a45cd9f92)\r\n\r\n#### Fixes the following issue(s)\r\n<!-- Prefix issues with \"Fixes\" so that GitHub closes them when the PR is merged (note that each \"Fixes #\" should be in its own item). Also add any other relevant links. -->\r\n- Fixes 'Channel icon on stream details disappear sometimes' [#10315](https://github.com/TeamNewPipe/NewPipe/issues/10315)\r\n\r\n\r\n#### APK testing\r\n<!-- Use a new, meaningfully named branch. The name is used as a suffix for the app ID to allow installing and testing multiple versions of NewPipe, e.g. \"commentfix\", if your PR implements a bugfix for comments. (No names like \"patch-0\" and \"feature-1\".)  -->\r\n\r\n#### Due diligence\r\n- [X] I read the [contribution guidelines](https://github.com/TeamNewPipe/NewPipe/blob/HEAD/.github/CONTRIBUTING.md).\r\n",
