        "body": "## Testing for regressions\r\n\r\nDebug APK (GH Actions): [app.zip](https://github.com/TeamNewPipe/NewPipe/files/12818818/app.zip)\r\n\r\n\r\n**Do not report any regressions here**, but in the corresponding issue: #10471 \r\n\r\nETA: within one week\r\n\r\n## TODO\r\n- [ ] Merge weblate\r\n- [ ] Update extractor commit to fix build\r\n- [ ] Merge #10500 \r\n\r\n<details><summary><h2>App changelog </h2></summary>\r\n\r\n## New\r\n- Access more content provided by creators which is grouped in different tabs. The content of the channel tabs can vary by service:  \r\n    - YouTube: videos, live, playlists, channels, about\r\n    - PeerTube: videos, playlists, about\r\n    - SoundCloud: tracks, playlists, albums, about\r\n    - Bandcamp: albums, tracks, about\r\n    - media.ccc.de: videos, about\r\n\r\n- Allow selecting image quality among multiple images #10062 \r\nNewPipe supports selecting the image quality among multiple image versions. This comes with three different presets which can be selected from within the settings (low, medium and high quality). This is most noticeable in the recently introduced card style for stream lists which is now abe to show thumbnails in higher resolutions. Some services (e.g. YouTube) do not always provide the highest quality thumbnails for those lists. \r\n\r\n## Improved\r\n- Adjust empty state message for `ListInfoFragments` depending on Info stream type #10304\r\n- Show loading indicator before opening the download dialog from the share menu #10407\r\n- Improved accessibility of player interfaces #10199\r\n- Include a high-resolution option in the default resolution settings #9987 \r\n- Add option to add playlist name and video name to playlist sharing content #10427 \r\n\r\n\r\n## Localization\r\n- Make capitalization of \"Night theme\" setting consistent with others #10313\r\n- Update Weblate & fix string formats #10376\r\n- Fix selection of wrong languages in language picker #10406\r\n\r\n\r\n## Fixed\r\n- Fix player audio focus not respecting mute #10275\r\n- Fix downloads of streams with missing `MediaFormat` #10165\r\n- [YouTube] Fix extraction of age-restricted music videos TeamNewPipe/NewPipeExtractor#1108 #10440\r\n- Fix restoring software license dialog #10436\r\n- Fix inconsistency between user interaction and database commit order when re-adding videos to a playlist #8248 \r\n\r\n## Development\r\n- Make \"latest release\" link more obvious to bug reporters #10331\r\n- Simplify `MainActivity.tabSelected(MenuItem)` #10360\r\n- Image minizier: replace `Number.toFixed(0)` with `Math.floor()` #10377\r\n- Update miscellaneous libraries #10234 #10244\r\n- Improve the download helpers using the Java 7 NIO API. #10248\r\n- Fix memory leaks and add documentation #10394\r\n- Replace `MathUtils.clamp` with Kotlin `coerceIn` #10224\r\n- Bump AGP to 8.1.1 #10428\r\n- Improve codequality #10435\r\n- Update extractor and remove `DeobfuscateException` handling #10440\r\n- Add workflow \"PR size labeler\" to label PRs based on the number of changed lines #10170 #10447\r\n</details>\r\n\r\n<details><summary><h2>NewPipe Extractor changelog </h2></summary>\r\n\r\n### New\r\n- Add support for channel tabs and channel tags #1082 #1092\r\n- [YouTube] Support more channel headers #1094\r\n- [YouTube] Support Shorts UI in playlists #1093\r\n- Multiple images support #889 #1113\r\n-  [YouTube] Add support for ultralow audio formats #1063\r\n\r\n### Improved\r\n- [YouTube] Improve and fix `YoutubeJavaScriptExtractor` #1087 #1091\r\n- [YouTube] Refactor JavaScript usage and fix extraction of obfuscated signature deobfuscation function #1108\r\n\r\n### Fixed\r\n- [media.ccc.de] Only extract kiosk live stream rooms if they are streaming #1089\r\n- [SoundCloud] Detect whether there are any more search results #1081\r\n\r\n### Development\r\n- Replace cryptographically secure random with regular random #1088\r\n- Bump org.junit:junit-bom from 5.9.3 to 5.10.0 #1083\r\n-  Bump actions/checkout from 3 to 4 #1103\r\n- [Badcamp] Fix StreamExtractorTest #1105\r\n- Use `Locale.forLanguageTag()` in tests #1107\r\n- Update copyright notices to use correct GPLv3 format #1110\r\n\r\n</details>",
