        "body": "<!-- Hey there. Thank you so much for improving NewPipe, and filling out the details. Having roughly the same layout helps everyone considerably :)-->\r\n\r\n#### What is it?\r\n- [ ] Bugfix (user facing)\r\n- [ ] Feature (user facing)\r\n- [x] Codebase improvement (dev facing)\r\n- [ ] Meta improvement to the project (dev facing)\r\n\r\n#### Description of the changes in your PR\r\nThis PR is a followup to TeamNewPipe/NewPipeExtractor#1108, where `DeobfuscateException` was replaced by a plain `ParsingException`. In ErrorInfo `DeobfuscateException`s were treated separately from other ParsingExceptions, including by showing a customized message, which has now been removed.\r\n\r\nI tested the changes and everything still works even after TeamNewPipe/NewPipeExtractor#1108.\r\n\r\n#### Fixes the following issue(s)\r\n<!-- Prefix issues with \"Fixes\" so that GitHub closes them when the PR is merged (note that each \"Fixes #\" should be in its own item). Also add any other relevant links. -->\r\n- Fixes https://github.com/TeamNewPipe/NewPipe/issues/10347\r\n\r\n#### Relies on the following changes\r\n<!-- Delete this if it doesn't apply to your PR. -->\r\n- [x] TeamNewPipe/NewPipeExtractor#1108\r\n\r\n#### APK testing\r\n<!-- Use a new, meaningfully named branch. The name is used as a suffix for the app ID to allow installing and testing multiple versions of NewPipe, e.g. \"commentfix\", if your PR implements a bugfix for comments. (No names like \"patch-0\" and \"feature-1\".)  -->\r\n<!-- Remove the following line if you directly link the APK created by the CI pipeline. Directly linking is preferred if you need to let users test.-->\r\nThe APK can be found by going to the \"Checks\" tab below the title. On the left pane, click on \"CI\", scroll down to \"artifacts\" and click \"app\" to download the zip file which contains the debug APK of this PR. You can find more info and a video demonstration [on this wiki page](https://github.com/TeamNewPipe/NewPipe/wiki/Download-APK-for-PR).\r\n\r\n#### Due diligence\r\n- [x] I read the [contribution guidelines](https://github.com/TeamNewPipe/NewPipe/blob/HEAD/.github/CONTRIBUTING.md).\r\n",
