        "body": "#### What is it?\r\n- [ ] Bugfix (user facing)\r\n- [ ] Feature (user facing)\r\n- [x] Codebase improvement (dev facing)\r\n- [ ] Meta improvement to the project (dev facing)\r\n\r\n#### Description of the changes in your PR\r\n- [Add comments and annotations](https://github.com/TeamNewPipe/NewPipe/commit/748c2babe9c34e533ed7fe97693d284f5d752fd1)\r\n- [Reorder the modifiers to comply with the Java Language Specification.](https://github.com/TeamNewPipe/NewPipe/commit/8bf2d996ea681271447e115cd3d535358e453e0c)\r\n- [Remove useless override](https://github.com/TeamNewPipe/NewPipe/commit/0acc3532c9cc29ca8b38375a65d878c095f7a376)\r\n\r\n#### APK testing\r\n<!-- Use a new, meaningfully named branch. The name is used as a suffix for the app ID to allow installing and testing multiple versions of NewPipe, e.g. \"commentfix\", if your PR implements a bugfix for comments. (No names like \"patch-0\" and \"feature-1\".)  -->\r\n<!-- Remove the following line if you directly link the APK created by the CI pipeline. Directly linking is preferred if you need to let users test.-->\r\nThe APK can be found by going to the \"Checks\" tab below the title. On the left pane, click on \"CI\", scroll down to \"artifacts\" and click \"app\" to download the zip file which contains the debug APK of this PR. You can find more info and a video demonstration [on this wiki page](https://github.com/TeamNewPipe/NewPipe/wiki/Download-APK-for-PR).\r\n\r\n#### Due diligence\r\n- [x] I read the [contribution guidelines](https://github.com/TeamNewPipe/NewPipe/blob/HEAD/.github/CONTRIBUTING.md).\r\n",
